function Home() {
  return (
    <div className="flex justify-center items-center flex-col">
      <div>
        <img
          src="https://www.wallpapertip.com/wmimgs/66-666819_website-design-background-creative-background-image-for-website.jpg"
          alt="Home_background"
        ></img>
      </div>
      <h1 className="text-3xl font-bold">This is the home page</h1>
      <p>Welcome to the page</p>
    </div>
  );
}

export default Home;
